import React from 'react';
import TopBar from '../TopBar/TopBar';
import './header.scss';
import MidlleBar from "../MidlleBar/MidlleBar";

const Header = () => {
    return (
        <header className="header">
                    <TopBar />
                    <MidlleBar/>
        </header>
    );
};

export default Header;
